import users from './DatabaseDefault';
import wallets from './DatabaseDefault';
import cards from './DatabaseDefault';
import payins from './DatabaseDefault';
import payouts from './DatabaseDefault';
import transfers from './DatabaseDefault';

export function importDatabase(){
    var value = JSON.stringify(users);
    localStorage.setItem("users", value);

    value = JSON.stringify(wallets);
    localStorage.setItem("wallets", value);

    value = JSON.stringify(cards);
    localStorage.setItem("cards", value);

    value = JSON.stringify(payins);
    localStorage.setItem("payins", value);

    value = JSON.stringify(payouts);
    localStorage.setItem("payouts", value);

    value = JSON.stringify(transfers);
    localStorage.setItem("tranfers", value);
}


export default importDatabase;
